import Vue from 'vue'
import VueRouter from 'vue-router';
Vue.use(VueRouter);

import tableDisplay from "../components/tableDisplay.vue"
const routes = [
   
    {
        path:'/tableDis',
        component:tableDisplay
    }
]

const router = new VueRouter({
    routes
})

export default router
